	 */
    Object.prototype.toggleClass = function (className) {
		this.classList.toggle(className);
	};

    /**
     * Remueve elementos
     */
    Constructor.prototype.remove = function(){
        this.each(function (item) {
            item.remove();
        });
    }

    /**
     * Encuentra el primer elemento dentro de otro
